/* eslint-disable no-irregular-whitespace */
import React from 'react';
import './Welcome.scss';

const Welcome = () => {
  return (
    <div className="Welcome">
      <span className="welcome-tag">Welcome</span>
      <br />
      <span className="sub-tag">To a Full Nail It Experience</span>
    </div>
  );
};

export default Welcome;
